import React from 'react';
import './Homepage.css';


type Flavor = {
  name: string;
  qty: number
}

const currFlavors = [
  { name: "vanilla", qty: 4 },
  { name: "chocolate", qty: 10 },
  { name: "mint chip", qty: 3 },
  { name: "strawberry", qty: 15 },
  { name: "phish food", qty: 40 }
]

const Flavors = (flavors: Flavor[]) => {
  return <div>
    <Flavors />
  </div>;
}

export default Flavors;
